private void determineVariantValidation()
{
    Enumerator enum = this.defaultProductDimensionFields().getEnumerator();
    while (enum.moveNext())
    {
        if (this.skipDataSourceValidateField(enum.current()))
        {
            InventTable::skipStandardVariantValidationInCurrentTransactionScope(true);
            break;
        }
    }

    enum = this.alternativeProductDimensionFields().getEnumerator();
    while (enum.moveNext())
    {
        if (this.skipDataSourceValidateField(enum.current()))
        {
            InventTable::skipAlternativeVariantValidationInCurrentTransactionScope(true);
            break;
        }
    }
}

private void initItemModelGroup()
{
    if (this.ItemModelGroupId)
    {
        InventModelGroup inventModelGroup = InventModelGroup::find(this.ItemModelGroupId);

        if (inventModelGroup)
        {
            InventModelGroupItem::updateModelGroupForItem(this.ItemNumber, this.DataAreaId, this.ItemModelGroupId, inventModelGroup.DataAreaId);
        }
    }
}

private void initStorageDimensionGroup()
{
    if (this.StorageDimensionGroupName)
    {
        this.StorageDimensionGroupRecId = EcoResStorageDimensionGroup::findByDimensionGroupName(this.StorageDimensionGroupName).RecId;

        if (this.StorageDimensionGroupRecId
            && !EcoResStorageDimensionGroupItem::findByItem(this.DataAreaId, this.ItemNumber).RecId)
        {
            EcoResStorageDimensionGroupItem ecoResStorageDimensionGroupItem;
            ecoResStorageDimensionGroupItem.ItemId                  = this.ItemNumber;
            ecoResStorageDimensionGroupItem.StorageDimensionGroup   = this.StorageDimensionGroupRecId;
            ecoResStorageDimensionGroupItem.ItemDataAreaId          = this.DataAreaId;
            ecoResStorageDimensionGroupItem.insert();
        }
    }

}

private void initTrackingDimensionGroup()
{
    if (this.TrackingDimensionGroupName)
    {
        this.TrackingDimensionGroupRecId = EcoResTrackingDimensionGroup::findByDimensionGroupName(this.TrackingDimensionGroupName).RecId;

        if (this.TrackingDimensionGroupRecId
            && (!ecoResTrackingDimensionGroupItem::findByItem(this.DataAreaId, this.ItemNumber).RecId))
        {
            EcoResTrackingDimensionGroupItem ecoResTrackingDimensionGroupItem;

            ecoResTrackingDimensionGroupItem.ItemId = this.ItemNumber;
            ecoResTrackingDimensionGroupItem.TrackingDimensionGroup = this.TrackingDimensionGroupRecId;
            ecoResTrackingDimensionGroupItem.ItemDataAreaId = this.DataAreaId;
            ecoResTrackingDimensionGroupItem.insert();
        }
    }
}

    public void persistEntity(DataEntityRuntimeContext _entityCtx)
    {
        if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert)
        {
            this.DefaultLedgerDimension = DimensionDefaultResolver::checkAndCreateSelfReference(tablenum(InventTable), this.ItemNumber, this.DefaultLedgerDimensionDisplayValue);

            var product = EcoResProduct::findByDisplayProductNumber(this.ProductNumber);
            EcoResProductReleaseManager::releaseProductWithLegalEntityData(
                        product.RecId,
                        CompanyInfo::findDataArea(this.DataAreaId).RecId,
                        this.ItemNumber,
                        this.SearchName,
                        TaxItemGroupHeading::find(this.PurchaseSalesTaxItemGroupCode).TaxItemGroup,
                        TaxItemGroupHeading::find(this.SalesSalesTaxItemGroupCode).TaxItemGroup
                );

			if (this.ShelfLifePeriodDays)
			{
                this.initItemModelGroup();
                this.initTrackingDimensionGroup();
			}

            this.initStorageDimensionGroup();
        }
        else if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Update)
        {
            if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, DefaultOrderType)))
            {
                InventTable::skipUpdateOfInventItemSetupSupplyType(true);
            }
        }

        this.determineVariantValidation();

        // This validation is performed on the entity level so there is no need to perform it on the table level
        InventTable::skipProductVariantUnitConversionValidationInCurrentTransactionScope(true);

        this.skipDataSourceValidateField(fieldNum(EcoResReleasedProductV2Entity, POSRegistrationBlockedDate), true);

        boolean skipValidation = WHSReservationHierarchyItemSkipValidateDeleteFlight::instance().isEnabled()
                                && _entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Delete;

        using (var whsReservationHierarchyItemSkipValidateDeleteContext = WHSReservationHierarchyItemSkipValidateDeleteContext::newSkipValidation(skipValidation))
        {
            super(_entityCtx);
        }
    }

public void mapEntityToDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    switch (_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTable):                
            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert)
            {
                // Reread the InventTable buffer that was inserted by EcoResProductReleaseManager in the persistEntity method
                _dataSourceCtx.setBuffer(InventTable::find(this.ItemNumber, true));
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventItemGroupItem):
            if (this.ProductGroupId && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, ProductGroupId)))
            {
                InventItemGroupItem inventItemGroupItem = _dataSourceCtx.getBuffer();
                inventItemGroupItem.ItemGroupDataAreaId = this.DataAreaId;
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventModelGroupItem):
            if (this.ItemModelGroupId && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, ItemModelGroupId)))
            {
                InventModelGroupItem inventModelGroupItem = _dataSourceCtx.getBuffer();
                inventModelGroupItem.ModelGroupDataAreaId = this.DataAreaId;
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, WHSReservationHierarchyItem):
            if (!this.InventoryReservationHierarchyName && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, InventoryReservationHierarchyName)))
            {
                this.skipDataSourceValidateField(fieldNum(EcoResReleasedProductV2Entity, ReservationHierarchyRecId), true);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, EcoResStorageDimensionGroup):
            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert)
            {
                if (!this.StorageDimensionGroupName && !this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, StorageDimensionGroupName)))
                {
                    //Field storageDimensionGroupName is not part of the import, it needs to be defaulted from the Product
                    EcoResProduct product = EcoResProduct::findByDisplayProductNumber(this.ProductNumber);
                    if (product.RecId)
                    {
                        EcoResStorageDimensionGroupProduct storageDimGroupProduct = EcoResStorageDimensionGroupProduct::findByProduct(product.RecId);
                        this.StorageDimensionGroupName = EcoResStorageDimensionGroup::find(storageDimGroupProduct.StorageDimensionGroup).Name;
                    }
                }
            }
        break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, EcoResTrackingDimensionGroup):
            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert)
            {
                if (!this.TrackingDimensionGroupName && !this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, TrackingDimensionGroupName)))
                {
                    //Field trackingDimensionGroupName is not part of the import, it needs to be defaulted from the Product
                    EcoResProduct product = EcoResProduct::findByDisplayProductNumber(this.ProductNumber);
                    if (product.RecId)
                    {
                        EcoResTrackingDimensionGroupProduct trackingDimGroupProduct = EcoResTrackingDimensionGroupProduct::findByProduct(product.RecId);
                        this.TrackingDimensionGroupName = EcoResTrackingDimensionGroup::find(trackingDimGroupProduct.TrackingDimensionGroup).Name;
                    }
                }
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, SalesTaxWithholdItemGroupHeading):

            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert && 
                this.SalesItemWithholdingTaxGroupCode)
            {
                TaxWithholdItemGroupHeading_TH itemWithholdingTaxGroup = TaxWithholdItemGroupHeading_TH::findByTaxWithholdItemGroup(this.SalesItemWithholdingTaxGroupCode);
                if (itemWithholdingTaxGroup)
                {
                    this.SalesItemWithholdingTaxGroupCodeRecId = itemWithholdingTaxGroup.RecId;
                }
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, PurchTaxWithholdItemGroupHeading):

            if (_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert &&
                this.PurchaseItemWithholdingTaxGroupCode)
            {
                TaxWithholdItemGroupHeading_TH itemWithholdingTaxGroup = TaxWithholdItemGroupHeading_TH::findByTaxWithholdItemGroup(this.PurchaseItemWithholdingTaxGroupCode);
                if (itemWithholdingTaxGroup)
                {
                    this.PurchaseItemWithholdingTaxGroupCodeRecId = itemWithholdingTaxGroup.RecId;
                }
            }
            break;

    }

    super(_entityCtx, _dataSourceCtx);

    switch (_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, WHSInventTable):
            if (!this.isStorageDimensionGroupWarehouseManagementEnabled())
            {
                if (_dataSourceCtx.isAnyFieldSetToNonDefaultValue(tableNum(EcoResReleasedProductV2Entity)))
                {
                    warning("@SCM:CannotSetWarehouseManagementInfoForNonWHSItems");
                    this.throwUpdateHasBeenCancelled();
                }

                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::None);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, PdsCatchWeightItem):
            if (!EcoResProduct::findByDisplayProductNumber(this.ProductNumber).PdsCWProduct)
            {
                if (_dataSourceCtx.isAnyFieldSetToNonDefaultValue(tableNum(EcoResReleasedProductV2Entity)))
                {
                    warning("@SCM:CannotSetCatchWeightInfoForNonCatchWeightProducts");
                    this.throwUpdateHasBeenCancelled();
                }

                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::None);
            }
            break;
    }
}

private boolean isStorageDimensionGroupWarehouseManagementEnabled()
{
    return this.StorageDimensionGroupName &&
            EcoResStorageDimensionGroup::findByDimensionGroupName(this.StorageDimensionGroupName).IsWarehouseWHSEnabled;
}

private boolean validateWriteInventTable(InventTable _inventTable)
{
    boolean ret = true;

    var crossTableData = this.crossTableDataAdaptor();

    if (_inventTable.Phantom && !_inventTable.canBePhantom(crossTableData))
    {
        ret = ret && checkFailed(strFmt("@SYS78966", fieldPName(InventTable, Phantom)));
    }

    if (_inventTable.AutoReportFinished && !_inventTable.isAutoReportAsFinishedAllowed(crossTableData))
    {
        ret = ret && checkFailed(strFmt("@SYS78966", fieldPName(InventTable, AutoReportFinished)));
    }

    if (!EcoResProductCrossTableManager::isItemStocked(this.ItemNumber, this.DataAreaId, crossTableData))
    {
        ret = ret && EcoResProductCrossTableManager::validateFieldsAreBlank(_inventTable, InventTable::stockedOnlyFields(), "@SCM:InventTableFieldMustBeBlankForNotStockedProduct");
    }

    if (ret && _inventTable.isProductVariantUnitConversionEnabled())
    {
        boolean isItemWHSEnabled = this.isStorageDimensionGroupWarehouseManagementEnabled();
        ret = _inventTable.validateProductVariantUnitConversion(this.InventoryUnitSymbol, this.PurchaseUnitSymbol, this.SalesUnitSymbol, isItemWHSEnabled);
    }

    ret = ret && EcoResProductCrossTableManager::validateReservationHierarchyForReleasedProduct(crossTableData);

    return ret;
}

private boolean validateWriteReleasedProduct(DataEntityRuntimeContext _entityCtx)
{
    boolean ret = true;
    InventTable inventTable                     = _entityCtx.getRuntimeContextByName(dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTable)).getBuffer();
    InventTableModule inventTableModuleInvent   = _entityCtx.getRuntimeContextByName(dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModuleInvent)).getBuffer();
    InventTableModule inventTableModulePurch    = _entityCtx.getRuntimeContextByName(dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModulePurch)).getBuffer();
    InventTableModule inventTableModuleSales    = _entityCtx.getRuntimeContextByName(dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModuleSales)).getBuffer();
    InventModelGroupItem inventModelGroupItem   = _entityCtx.getRuntimeContextByName(dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventModelGroupItem)).getBuffer();

    #EcoResProductDetailsExtended
    Map mapBuffers = new Map(Types::String, Types::Record);
    mapBuffers.insert(#InventTableDS, inventTable);
    mapBuffers.insert(#InventDS, inventTableModuleInvent);
    mapBuffers.insert(#PurchDS, inventTableModulePurch);
    mapBuffers.insert(#SalesDS, inventTableModuleSales);
    mapBuffers.insert(#InventModelGroupItemDS, inventModelGroupItem);

    EcoResReleasedProductFactory  releasedProductFactory = EcoResReleasedProductFactory::construct();
    EcoResReleasedProduct releasedProduct = releasedProductFactory.getReleasedProductFromMap(mapBuffers);
    ret = releasedProduct.validateWrite();

    return ret;
}

private boolean validateWriteInventTableModuleInvent(InventTableModule _inventTableModuleInvent)
{
    boolean ret = true;

    var crossTableData = this.crossTableDataAdaptor();

    if (!EcoResProductCrossTableManager::isItemStocked(this.ItemNumber, this.DataAreaId, crossTableData))
    {
        ret = ret && EcoResProductCrossTableManager::validateFieldsAreBlank(_inventTableModuleInvent, InventTableModule::inventStockedOnlyFields());
    }

    return ret;
}

private boolean validateWriteTMSInventEnabled()
{
    if (!this.AreTransportationManagementProcessesEnabled
        && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, AreTransportationManagementProcessesEnabled))
        && WHSInventEnabled::exist(this.ItemNumber))
    {
        return checkFailed("@SCM:CannotDisableTMSProcessesForWHSItem");
    }

    return true;
}

private boolean validateWriteInventModelGroupItem(InventModelGroupItem _inventModelGroupItem)
{
    boolean ret = true;

    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, ItemModelGroupId)))
    {
        ret = _inventModelGroupItem.validateFieldValue(fieldStr(InventModelGroupItem, ModelGroupId));
    }

    return ret;
}

private boolean validateWriteDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    if (this.skipDataSourceValidateWrite())
    {
        return true;
    }

    switch (_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTable):
            return this.validateWriteInventTable(_dataSourceCtx.getBuffer()) && this.validateWriteReleasedProduct(_entityCtx);

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModuleInvent):
            return this.validateWriteInventTableModuleInvent(_dataSourceCtx.getBuffer());

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, TMSInventEnabled):
            return this.validateWriteTMSInventEnabled();

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventModelGroupItem):
            return this.validateWriteInventModelGroupItem(_dataSourceCtx.getBuffer());
    }

    return true;
}

public boolean insertEntityDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    boolean ignoreDataSource = false;
    Common buffer;

    switch (_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventItemGroupItem):
            if (this.ProductGroupId)
            {
                buffer = InventItemGroupItem::findByItemIdLegalEntity(this.ItemNumber, this.DataAreaId, true);
            }
            else
            {
                ignoreDataSource = true;
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventModelGroupItem):
            if (this.ItemModelGroupId)
            {
                buffer = InventModelGroupItem::findByItemIdLegalEntity(this.ItemNumber, this.DataAreaId, true);
            }
            else
            {
                ignoreDataSource = true;
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventItemSetupSupplyType):
            buffer = InventItemSetupSupplyType::find(this.ItemNumber, this.DataAreaId, true);
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, EcoResStorageDimensionGroupItem):
            buffer = EcoResStorageDimensionGroupItem::findByItem(this.DataAreaId, this.ItemNumber, true);
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, EcoResTrackingDimensionGroupItem):
            buffer = EcoResTrackingDimensionGroupItem::findByItem(this.DataAreaId, this.ItemNumber, true);
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModuleInvent):
            buffer = InventTableModule::find(this.ItemNumber, ModuleInventPurchSales::Invent, true);
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModuleSales):
            buffer = InventTableModule::find(this.ItemNumber, ModuleInventPurchSales::Sales, true);
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModulePurch):
            buffer = InventTableModule::find(this.ItemNumber, ModuleInventPurchSales::Purch, true);
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, RetailInventTable):
            buffer = RetailInventTable::find(this.ItemNumber, true);
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, TMSInventEnabled):
            if (!this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, AreTransportationManagementProcessesEnabled)))
            {
                ignoreDataSource = true;
            }
            else if (!this.AreTransportationManagementProcessesEnabled)
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            }
            break;
        case dataEntityDataSourceStr(EcoResReleasedProductEntity, WHSInventTable):
            WHSInventTable bufferUpdate = _dataSourceCtx.getBuffer();
            if (this.checkFilterCodesAndUpdate(bufferUpdate))
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Update);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, EcoResProductServiceWarranty):
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, WarrantyInventTable):
            if (this.serviceType != EcoResProductServiceType::Warranty)
            {
                ignoreDataSource = true;
            }
            break;

        default:
            EventHandlerResult bufferResult = new EventHandlerResult();
            this.insertEntityDataSourceDelegate(this, _entityCtx, _dataSourceCtx, bufferResult);

            if (bufferResult.hasResult())
            {
                buffer = bufferResult.result();
            }
            break;
    }

    if (ignoreDataSource)
    {
        return true;
    }

    if (buffer)
    {
        _dataSourceCtx.setBuffer(buffer);
        _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Update);
        this.mapEntityToDataSource(_entityCtx, _dataSourceCtx);
    }

    if (!this.validateWriteDataSource(_entityCtx, _dataSourceCtx))
    {
        this.throwUpdateHasBeenCancelled();
    }

    return super(_entityCtx, _dataSourceCtx);
}

/// <summary>
/// Delegate for handling any additional data sources to be inserted through the entity.
/// </summary>
/// <param name = "_this">Reference back to the entity.</param>
/// <param name = "_entityCtx">Data entity runtime context.</param>
/// <param name = "_dataSourceCtx">Data entity data source runtime context.</param>
/// <param name = "_result">An instance of <c>EventHandlerResult</c> subscribers can use to return the corresponding record buffer.</param>
delegate void insertEntityDataSourceDelegate(EcoResReleasedProductV2Entity _this, DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx, EventHandlerResult _result)
{
}

private void throwUpdateHasBeenCancelled()
{
    throw error("@SYS18447");
}

public boolean updateEntityDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    boolean ignoreDataSource = false;

    switch (_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, TMSInventEnabled):
            if (!this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, AreTransportationManagementProcessesEnabled)))
            {
                ignoreDataSource = true;
            }
            else if (!this.AreTransportationManagementProcessesEnabled)
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, EcoResStorageDimensionGroupItem):
            if (!this.StorageDimensionGroupName && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, StorageDimensionGroupName)))
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, EcoResTrackingDimensionGroupItem):
            if (!this.TrackingDimensionGroupName && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, TrackingDimensionGroupName)))
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventItemGroupItem):
            if (!this.ProductGroupId && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, ProductGroupId)))
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventModelGroupItem):
            if (!this.ItemModelGroupId && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, ItemModelGroupId)))
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, WHSReservationHierarchyItem):
            if (!this.InventoryReservationHierarchyName && this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, InventoryReservationHierarchyName)))
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, WHSInventTable):
            WHSInventTable bufferUpdate = _dataSourceCtx.getBuffer();
            if (this.checkFilterCodesAndUpdate(bufferUpdate))
            {
                _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Update);
            }
            break;

        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModuleInvent):
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTableModuleSales):
            // This is necessary to avoid update conflicts in case some of the sales price model fields have
            // already triggered an update of InventTableModule datasources
            _entityCtx.detectConflictForDatasource(_dataSourceCtx);
            break;
    }

    if (ignoreDataSource)
    {
        return true;
    }

    if (!this.validateWriteDataSource(_entityCtx, _dataSourceCtx))
    {
        throw error("@SYS18447");
    }

    return super(_entityCtx, _dataSourceCtx);
}

public void initValue()
{
    if (!this.skipNumberSequenceCheck())
    {
        NumberSeqRecordFieldHandler::enableNumberSequenceControlForField(
            this, fieldNum(EcoResReleasedProductV2Entity, ItemNumber), InventParameters::numRefItemId());
    }

    super();
}

public boolean validateWrite()
{
    boolean ret;

    ret = super();

    if (ret && !this.PrimaryVendorAccountNumber && this.IsDeliveredDirectly)
    {
        ret = checkFailed("@MCR12178");
    }

    if (ret && this.UpdateProductVariantLifecycleState==NoYes::Yes && this.ProductSubType != EcoResProductSubtype::ProductMaster)
    {
        ret = checkFailed("@SCM:UpdateProductVariantLifecycleStateError");
    }
    EcoResProduct product = EcoResProduct::findByDisplayProductNumber(this.ProductNumber);
    EcoResStorageDimensionGroup ecoResStorageDimensionGroup;
    EcoResTrackingDimensionGroup ecoResTrackingDimensionGroup;

    if (ret && this.StorageDimensionGroupName)
    {
        ecoResStorageDimensionGroup = EcoResStorageDimensionGroup::findByDimensionGroupName(this.StorageDimensionGroupName);

        ret = EcoResStorageDimensionGroupItem::validateStorageDimensionGroupIsSameAsInProduct(
            ecoResStorageDimensionGroup,
            product.RecId);
    }

    if (ret && this.TrackingDimensionGroupName)
    {
        ecoResTrackingDimensionGroup = EcoResTrackingDimensionGroup::findByDimensionGroupName(this.TrackingDimensionGroupName);

        ret = EcoResTrackingDimensionGroupItem::validateTrackingDimensionGroupIsSameAsInProduct(
            ecoResTrackingDimensionGroup,
            product.RecId);
    }

    InventTable inventTable = InventTable::find(this.ItemNumber);

    if (ret && inventTable.RecId
        && (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, StorageDimensionGroupName))
        || this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, trackingDimensionGroupName))))
    {
        InventTableInventoryDimensionGroups inventTableInventoryDimensionGroups;

        inventTableInventoryDimensionGroups = InventTableInventoryDimensionGroups::newFromItemAndDimGroups(
            inventTable.DataAreaId,
            inventTable.ItemId,
            ecoResStorageDimensionGroup.RecId,
            ecoResTrackingDimensionGroup.RecId,
            product.RecId);

        ret = inventTableInventoryDimensionGroups.validateNewDimensionGroupsForItem();

    }
    return ret;
}

