private boolean checkFilterCodesAndUpdate(WHSInventTable _whsInventTable)
{
    boolean ret = false; 

    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, FirstProductFilterCode)))
    {

        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 1, this.FirstProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, SecondProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 2, this.SecondProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, ThirdProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 3, this.ThirdProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, FourthProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 4, this.FourthProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, FifthProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 5, this.FifthProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, SixthProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 6, this.SixthProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, SeventhProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 7, this.SeventhProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, EighthProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 8, this.EighthProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, NinthProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 9, this.NinthProductFilterCode) || ret;
    }
    if (this.isFieldSet(fieldNum(EcoResReleasedProductV2Entity, TenthProductFilterCode)))
    {
        ret = this.checkFiltercodeAndUpdate(_whsInventTable, 10, this.TenthProductFilterCode) || ret;
    }
    return ret;
}

private boolean checkFiltercodeAndUpdate(WHSInventTable _whsInventTable, int _arrayIndex, WHSFilterNum _filterCode)
{
    if (_whsInventTable.FilterCode[_arrayIndex] != _filterCode)
    {
        _whsInventTable.FilterCode[_arrayIndex] = _filterCode;
        return true;
    }
    return false;
}

/// <summary>
/// Sets explicit delete operations.
/// </summary>
/// <param name = "_entityCtx">The entity record.</param>
/// <param name = "_dataSourceCtx">The entity datasource record.</param>
/// <returns>true if succeeded; otherwise, false.</returns>
public boolean deleteEntityDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    switch(_dataSourceCtx.name())
    {
        case dataEntityDataSourceStr(EcoResReleasedProductV2Entity, InventTable):
            _dataSourceCtx.setDatabaseOperation(DataEntityDatabaseOperation::Delete);
            _dataSourceCtx.setDataSaved(false);
            break;
    }

    return super(_entityCtx, _dataSourceCtx);;
}

